var app=angular.module("myApp",["ng","ngRoute"]);app.controller("parentCtrl",["$scope","$location",function(a,b){a.jump=function(c){b.path(c)}}]);app.config(function(a){a.when("/start",{templateUrl:"tpl/start.html"}).when("/detail",{templateUrl:"tpl/detail.html"}).when("/main",{templateUrl:"tpl/main.html"}).when("/myOrder",{templateUrl:"tpl/myOrder.html"}).when("/order",{templateUrl:"tpl/order.html"}).otherwise({redirectTo:"/start"})});